import React, { useState } from 'react';

const Mybutton = () => {

    const[count,setCount] = useState

    function handleButton(){

        setCount(count+ 1)


        
    }
    return (
        <div>
            <button onClick={handleButton}>
                Button {count}
            </button>
        </div>
    );
}

export default Mybutton;
